import React from 'react';
import { HiArrowNarrowRight } from 'react-icons/hi';
// import me from '../assets/me.png';
import { Link } from "react-scroll"; 

const Home = () => {
  return (
    <div
    name="home"
    className="h-screen w-full bg-[#000000]"
  >
    <div className="max-w-screen-lg mx-auto flex flex-col items-center justify-center h-full px-4 md:flex-row">
      <div className="flex flex-col justify-center h-full">
        <h2 className="text-4xl sm:text-7xl font-bold text-white">
          Hey There! I'm <span className="text-yellow-custom">Mithish</span>
        </h2>
        <p className="text-gray-500 py-4 max-w-md text-center">
           Placeholder
        </p>
        <div>


  <Link
    to="about"
    smooth
    duration={500}
    className="group text-black w-fit px-6 py-3 my-2 flex items-center rounded-md bg-white cursor-pointer"
  >
    About Me
    <span className="group-hover:rotate-90 duration-300">
      <HiArrowNarrowRight size={25} className="ml-3" />
    </span>
  </Link>
</div>
        {<img
          src={mithish.png}  
          alt="my profile"
          className="rounded-2xl mx-auto w-2/3 md:w-full"
        /> }
      </div>
    </div>
  </div>
  );
};
export default Home;
